        return (
            <>
                <Container>
                    <Row className='fila'>
                        <Col>
                            <img src='https://coreui.io/react/demo/static/media/logo.406a451a.svg'/>
                        </Col>
                        <Col>
                            <i class="fa fa-bars"></i>
                        </Col>
                    </Row>
                </Container>
                <style jsx>{`
                    img{
                        width: 80%;
                    }

                    .fila{
                       border: solid 1px;
                    }
                `}</style>
            </>
        );
    }
}
